The "using enum" directive is used to bring the enum values into the current scope, so you can use them without the scope resolution operator. However, it does not bring the enum values into the current scope as variables. It brings them into the current scope as values. 

So, in your case, you can use the enum values without the scope resolution operator, but you still need to use the scope resolution operator to access the enum values. 

